import React, { Component } from 'react';
import Price from './Price'


class Product extends React.Component {
    render() {
        return (
            <>
                <h1>
                    product name {this.props.name}
                    <Price /> {this.price}
                </h1>

                {/* <h2></h2> */}


            </>
        );
    };

}

export default Product;
